import React from 'react';
import styles from "./"

const Coin = ({name, image, symbol, price, marketCap, pricechange}) => {
    return (
        <div className={Style.save}>
            <img sr={image} alt="Logo"/>
            <span>{name}</span>
            <span>{symbol}</span>
            <span>{price}</span>
            <span>{marketCap}</span>
            <span>{pricechange}</span>
        </div>
            
    );
};

export default Coin;
